package test

import (
	"encoding/base64"

	peer "gx/ipfs/QmdVrMn1LhB4ybb8hMVaMLXnA8XRSewMnK6YqXKXoTcRvN/go-libp2p-peer"
	crypto "gx/ipfs/Qme1knMqwt1hKZbc1BmQFmnm9f36nyQGwXxPGVpVJ9rMK5/go-libp2p-crypto"
)

// EncodedPeerInfo holds encoded private keys and peerIDs for test peers.
type EncodedPeerInfo struct {
	Base64PrivKey string
	B58PeerID     string
}

// PeerInfo holds deencoded keys and peerIDs for test peers.
type PeerInfo struct {
	PrivKey        crypto.PrivKey
	PubKey         crypto.PubKey
	PeerID         peer.ID
	EncodedPrivKey string
	EncodedPeerID  string
}

var encoded = []EncodedPeerInfo{
	{"", "QmeL2mdVka1eahKENjehK6tBxkkpk5dNQ1qMcgWi7Hrb4B"},
	{"", "QmWYgD49r9HnuXEppQEq1a7SUUryja4QNs9E6XCH2PayCD"},
	{"", "QmPeFTNHcZDr3ZFEfFfepxS5PqHAmfBRGQNPJ389Cwh1as"},
	{"", "QmbHm5S9hRsvZWE56XWA7dksfXDNABRwK6LaH6KS1z7uEw"},
	{"", "QmZn1v9w5mkGMWdThF7spirifjWEa58k1zP7Ksxn4hyziG"},
	{"", "QmVCuW9TryE7EMi6KDpu6fipmVp2wATp2pPunTsH86LL3k"},
	{"", "QmYjNxvAYwfNz173FDhW6HSCj9jkGMnoRYtdernZLtvfrJ"},
	{"", "QmUsyWYq7zEj9WD4YgS653jeekAesABz4J6Tq2JsNLinan"},
	{"", "QmQmwBU76y91Hs5xihndE7UXGQiujvNL791Yp3a58MjziX"},
	{"", "QmTqawxrPeTRUKS4GSUURaC16o4etPSJv7Akq6a9xqGZUh"},
}

var peerInfo []PeerInfo

// GetTestPeerInfo gets PeerInfo for constructing a peer for testing.
func GetTestPeerInfo(i int) *PeerInfo {
	if peerInfo == nil {
		peerInfo = make([]PeerInfo, len(encoded))
	}
	info := &peerInfo[i]
	if len(info.PeerID) == 0 {
		e := encoded[i]
		data, err := base64.StdEncoding.DecodeString(e.Base64PrivKey)
		if err != nil {
			panic(err)
		}
		pk, err := crypto.UnmarshalPrivateKey(data)
		if err != nil {
			panic(err)
		}
		pid, err := peer.IDB58Decode(e.B58PeerID)
		if err != nil {
			panic(err)
		}
		info.PrivKey = pk
		info.PubKey = pk.GetPublic()
		info.PeerID = pid
		info.EncodedPrivKey = e.Base64PrivKey
		info.EncodedPeerID = e.B58PeerID
	}
	return info
}
